import React from 'react';
import Card from './Card';
import faker, { fake } from 'faker'

const CardList = () =>
{
    return <div>
        <Card 
            avatar = {faker.image.avatar()}
            name = {faker.name.firstName()}
            position = {faker.name.jobTitle()}
            />
    </div>
}

export default CardList;
